import React, { useContext, useState } from "react";
import { Button } from "../MicroComponents/buttons";
import CustomInput from '../MicroComponents/input'
import { Label, Input } from "@rebass/forms";
import "./index.css";
export default () => {
  return (
      <form className="form">
        <section>
        <CustomInput
          labelText="Email"
          id="email"
          formControlProps={{
            fullWidth: true
          }}
          
     
          type="text"
        />
        </section>
        <CustomInput
          labelText="Password"
          id="password"
          formControlProps={{
            fullWidth: true
          }}
     
          type="password"
        />

        <Button title='Login' />
      </form>

  );
};
